ostly on weekends and summertime to target casual members\n","* Promotions should be run from May to September\n","* Offer more classic bikes in many stations  \n","\n","**What next steps wound you or your stakeholders take based on your findings?**\n","* Target customers in the weekend and summertime\n","* Focus more on using the classic bike to attract more riders\n","* Run more promotion in densely populated areas where cyclistic can be expanded\n","\n","**Is there additional data you could use to expand on your findings?**\n","* Age of membership information should be required\n","* The purpose for bike usage and type of occupation of membership information should be required"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":167.412024,"end_time":"2023-03-15T00:40:31.651672","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-03-15T00:37:44.239648","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}